  params.tau = 2
  params.security_level = "R5N1_1KEM_0d"
  def hexToByteArray(hex : String) = {
    val r  = hex.split(" ") map (a => (Integer.parseInt(a,16)  & 0xFF).toByte )
    r foreach (a => println(a.toString))
    r
  }
