  print(pk_hex)
  println
  Util.printHex(sk)
  assert(Util.toHexString(sk).equalsIgnoreCase("91282214654CB55E7C2CACD53919604D"))
  assert(pk_hex.equalsIgnoreCase(""))
  println
  print("SK = ")
  Util.printHex(sk)
  val (ct,k) = r5_cpa_kem_char.encapsulate(pk)
  println
  print("CT = ")
  ct.bitStringToString foreach (x => {
    print("%02X".format(x.toInt))
    ct_hex += "%02X".format(x.toInt)
  })

  assert(ct_hex.equalsIgnoreCase(""))
  println
  print("K = ")
  k foreach (x =>  print("%02X".format(x)))
  println
  val check = r5_cpa_kem_char.decapsulate(ct,sk)
  print("Message = ")
  check foreach (x =>  print("%02X".format(x)))
  println
  assert(check zip k forall((a => a._1 == a._2)))
  println("End  of test")



